    return (
    <div className="rowcol-lg-4 col-md-6 mx-auto">
    <AppHeader/>
    <HeadData/>
    <SearchPanel/>
    <DataFromServer/>
    </div>);
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <App />
);

